import React from "react";


export interface IPropsPageSINavbar {

}

export interface IStatePageSINavbar {

}

export class SINavbar extends React.Component<IPropsPageSINavbar, IStatePageSINavbar> {
    constructor(props: IPropsPageSINavbar) {
        super(props);
    }

    render() {
        return (
            <div style={{textAlign: "center", whiteSpace: "nowrap", position: "fixed", minWidth: "100%",
                     background: "#244058",
                     color: "#333333",
                     fontSize: "16px",
                     fontWeight: "bold",
                 }}>

                <div style={{}}>

                    <div style={{display: "flex"}}>
                        <div>
                            <ul style={{
                                display: "inline-block", listStyle: "none", margin: 0,
                                padding: 0, boxSizing: "border-box", whiteSpace: "nowrap", textAlign: "center"
                            }}>
                                {/*Start Navbar*/}
                                <li style={{
                                    cursor: "pointer",
                                    display: "inline-block",
                                    zoom: 1,
                                    verticalAlign: "middle",
                                    padding: 0,
                                    margin: 0,
                                    height: "100%",
                                    position: "relative",
                                    boxSizing: "border-box",
                                }}>
                                    <a style={{
                                        color: "#ffffff",
                                        padding: ".5em 1em",
                                        display: "block",
                                        lineHeight: 1.6,
                                        fontSize: "16px",
                                        textAlign:"center",
                                    }}
                                    >
                                        <b> Login in </b>
                                    </a>
                                </li>
                            </ul>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}
